function configureClock(){var n=new StationClock("clock");n.body=StationClock.NoBody;n.dial=StationClock.SwissStrokeDial;n.hourHand=StationClock.PointedHourHand;n.minuteHand=StationClock.PointedMinuteHand;n.secondHand=StationClock.HoleShapedSecondHand;n.boss=StationClock.NoBoss;n.minuteHandBehavoir=StationClock.ElasticBouncingMinuteHand;n.secondHandBehavoir=StationClock.ElasticBouncingSecondHand;n.dialColor="rgb(235,235,235)";n.hourHandColor="rgb(360,360,360)";n.minuteHandColor="rgb(360,360,360)";window.setInterval(function(){n.draw()},50)}$(function(){$('li.nav-item > a[href="'+window.location.pathname+'"]').parent().addClass("active");var t=2e4,i=1e3,n=t;$("#rotator-countdown").text(n/1e3);setInterval(function(){var n=$("#next-url").attr("href");n||(n="/Rotator/Next");window.location.assign(n)},t);setInterval(function(){n-=i;$("#rotator-countdown").text(n/1e3)},i);configureClock()});